import React from 'react'
import './Navbar.css'
import logo from '../Assets/shopp.jpeg'
export default function Navbar() {
  return (
    <div className='navbar'>
    <div className="nav-logo"></div>
<img src={logo} alt="" />
<p>SHOPPER</p>

    </div>
  )
}
